What a fascinating challenge!

Since the order of the options is randomized for each trial, I'll rely on a strategy that doesn't depend on the specific order of the options. I'll notice that none of the given options are "▷" or what appears to be a " circle surrounded by a square" (commonly seen in conjunction with the term "box");

My strategy is to opt for symmetry. Many conventionally used variables are very symmetric in design so as to not confuse with other mathematical constants:  mean is denoted with a oval (◯), median is a pointed edge (▢), and the modal is an asterisk (*) (☆); I choose △.
